import "./tab-career.css"
import React, { useState } from 'react';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';


function MyTabs() {
  const [key, setKey] = useState('home');


  return (

    
    <Tabs activeKey={key} onSelect={(k) => setKey(k)} className="my-tabs">
      <Tab eventKey="fullTime" title="Full-time Jobs">
        <br/>
 
        <h1 className="fullTime-title">This is Full time Job Page</h1>

      </Tab>
      <Tab eventKey="freelance" title="Freelance Jobs">
        <p>This is the Freelance Job</p>
        <h1 className="freelance-title">This is Full time Job Page</h1>
      </Tab>

    </Tabs>
  );
}

export default MyTabs;
